import React from "react";

const routes = [
  {
    path: "/",
    component: React.lazy(() => import("./home")),
  },
  {
    path: "/statistics",
    component: React.lazy(() => import("./statistics")),
  },
  {
    path: "/comment",
    component: React.lazy(() => import("./comment")),
  },
  {
    path: "(.*)",
    component: React.lazy(() => import("./error")),
  },
];

export default routes;
